const Contactform = () =>{
    return (
        <div className="contactform">
            <form>
                <label id="get-in-touch">CONTACT US</label>
                <h1>GET IN TOUCH</h1>
            
                <label>Reference Number:</label>
                <input type="text" placeholder="1231231"/> 
                <input type="text" placeholder="Please enter your email here:"/>
                <input type="text" placeholder="Please enter your fullname here:"/>
                <input type="text" placeholder="Please enter your contact number here:"/>
                <textarea placeholder="Type your feedback here" /> 
                <input type="submit"/>
            </form>
        </div>
    );
};

export default Contactform;
